import { DISCIPLINES_ROUTE } from '../utils/consts';
import '../styles/css.css';
import { Col } from 'react-bootstrap';
import { useHistory } from 'react-router-dom/cjs/react-router-dom';
import { observer } from 'mobx-react-lite';
import DisciplineStore from '../store/DisciplineStore';

const DisciplineList = observer(() => {
  const history = useHistory();

  const handleDisciplineClick = (name) => {
    history.push(`${DISCIPLINES_ROUTE}/${name}`);
  };

  return (
    
    <Col className="countries">
      {DisciplineStore.disciplines.map((discipline) => (
        <div
          key={discipline.id}
          className="i"
          onClick={() => handleDisciplineClick(discipline.name)}
        >
          <img
            className="flag"
            src={discipline.image}
            alt={discipline.name}
          />
          {discipline.name}
        </div>
      ))}
    </Col>
  );
});

export { DisciplineList };
